import React from 'react';
const Child = (props) => 
{
  return (
    <section className="my-tasks">
    <div key ={this.props.task} >
      <p>{this.props.task}</p>
      <p>{props.assignee}</p>
      <button className="done" >Add Task</button>
      <button className="delete" class = "fa fa-check-circle">Add Task</button>
    </div>
  </section>
      )
}
export default Child;
